(window.webpackJsonp=window.webpackJsonp||[]).push([[290],{645:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1238-nguoi-con-đang-bu-sua-u"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1238-nguoi-con-đang-bu-sua-u"}},[n._v("#")]),n._v(" Chương 1238: Ngươi còn đang bú sữa ư?")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1238: Ngươi còn đang bú sữa ư?"),t("br"),t("br"),n._v("“Phốc!”"),t("br"),t("br"),n._v("Một ngụm máu tươi phun ra, Tống Hiên thân thể nhoáng một cái, cứ thế mà tức ngất đi."),t("br"),t("br"),n._v("Đường đường chuẩn bát tinh danh sư, đi tới yếu nhất phong hào đế quốc, dựa theo ý nghĩ của hắn, hẳn là mang theo quyền uy tuyệt đối, một lời ra, mà vạn người theo..."),t("br"),t("br"),n._v("Kết quả, tất cả danh sư không nghe lời, ra tay với hắn ngược lại cũng thôi, bị một cái lô đỉnh đánh phế bỏ... Đáng giận nhất là là, đối phương còn một mặt dáng vẻ vô tội..."),t("br"),t("br"),n._v("Ngươi cho lô đỉnh chỉ điểm, động tác mặc dù rất nhỏ, nhưng thân là người đối chiến, kiêm chuẩn bát tinh danh sư, vẫn có thể nhẹ nhõm nhìn ra được."),t("br"),t("br"),n._v("Chỉ điểm vũ khí động thủ, đánh ta như thế, giả bộ ngây thơ vô tri bộ dạng, với ngươi không quan hệ..."),t("br"),t("br"),n._v("Có thể lại không hổ thẹn điểm ư?"),t("br"),t("br"),n._v("Cắt?"),t("br"),t("br"),n._v("Cắt em gái ngươi ah!"),t("br"),t("br"),n._v("Mặc dù phế bỏ, cũng hầu như so không có tốt a!"),t("br"),t("br"),n._v("Thấy đối phương vậy mà ngất đi, Trương Huyền lắc đầu, đem dao găm cất kỹ, nắm lấy người bên trong, đem hắn cứu tỉnh, lúc này mới quay đầu nhìn về phía Kim Nguyên đỉnh, khuôn mặt trầm xuống: “Thật sự là liều lĩnh, còn không qua đây xin lỗi?”"),t("br"),t("br"),n._v("“Vâng!”"),t("br"),t("br"),n._v("To béo thân thể, vịt đồng dạng đi tới, Kim Nguyên đỉnh thoạt nhìn tràn đầy thành khẩn: “Tống sư, là ta không đúng, nếu không... Ta để ngươi đá hai cước!”"),t("br"),t("br"),n._v("Nói hết đem chân vạc mở ra, như là bổ ra chân."),t("br"),t("br"),n._v("“Phốc!”"),t("br"),t("br"),n._v("Tống Hiên lần nữa máu tươi phun ra."),t("br"),t("br"),n._v("Ngươi có cọng lông ah, bị ta đá..."),t("br"),t("br"),n._v("Lại nói, ta đường đường chuẩn bát tinh danh sư, bị đá chỗ hiểm, sau đó lại để cho người ta bổ chân chờ lấy đá tới... Mặt còn cần hay không?"),t("br"),t("br"),n._v("“Trương Huyền, ngươi ngang nhiên cướp ngục, bỏ qua danh sư trừng phạt cùng quy tắc, không biết lễ phép, giật dây vũ khí, ra tay với ta, ta nhất định sẽ đem chuyện ngày hôm nay, như thực chất báo lên...”"),t("br"),t("br"),n._v("Vẻ mặt dữ tợn, Tống Hiên vung tay tránh thoát Trương Huyền nâng."),t("br"),t("br"),n._v("“Như thực chất báo lên?”"),t("br"),t("br"),n._v("“Không sai!” Tống Hiên cắn răng."),t("br"),t("br"),n._v("“Vậy được rồi! Kim Nguyên đỉnh, ta đem vị này Tống sư, giao cho ngươi, chiếu cố thật tốt...”"),t("br"),t("br"),n._v("Trương Huyền xua tay."),t("br"),t("br"),n._v("“Được rồi!” Tràn đầy hưng phấn, Kim Nguyên đỉnh thô to chân vạc nâng lên, xem ra bất cứ lúc nào cũng sẽ lần nữa đá ra đi."),t("br"),t("br"),n._v("“Ngươi...” Lần nữa nhoáng một cái, Tống Hiên theo bản năng lui về sau hai bước, đang nghĩ vận chuyển chân khí, cùng đối phương cá chết lưới rách, liền nghe đến bầu trời một cái Thánh thú kêu to, vang tận mây xanh, ngay sau đó nhìn thấy một đoàn hỏa vân từ đằng xa bay tới."),t("br"),t("br"),n._v("“Là Thánh vực lục trọng Thánh thú, Hỏa Vân Thánh điểu!”"),t("br"),t("br"),n._v("Tống Hiên con ngươi co rụt lại, nghĩ tới điều gì, tràn đầy kích động: “Là... Liên minh đế quốc Diêu Mạn Thiên, Diêu sư!”"),t("br"),t("br"),n._v("“Diêu Mạn Thiên?” Trương Huyền cau mày, Minh Lý Chi Nhãn nhúc nhích, hướng hỏa vân phương hướng nhìn sang."),t("br"),t("br"),n._v("Đầu này Hỏa Vân Thánh điểu sống lưng bên trên, quả nhiên đứng một bóng người, là nữ tử, khoảng bốn mươi tuổi, một thân tố y, dung mạo không tính là quá đẹp, so với Vệ Nhiễm Tuyết kém không ít, nhưng khí chất cao nhã, cho người ta một loại xuất trần thoát tục hương vị, tựa như tiên tử."),t("br"),t("br"),n._v("Nhất là trước ngực danh sư huy chương, tám khỏa sao lóe lên, dưới ánh mặt trời, mười phần loá mắt."),t("br"),t("br"),n._v("“Bát tinh danh sư?”"),t("br"),t("br"),n._v("Lại là một vị bát tinh danh sư!"),t("br"),t("br"),n._v("Cũng liền nói rõ, thực lực thấp nhất, đều đạt đến Thánh vực lục trọng Lĩnh Vực cảnh, vô địch chân chính cường giả!"),t("br"),t("br"),n._v("Trong lúc khiếp sợ, Hỏa Vân Thánh điểu liền đến đến đỉnh đầu, vị này Diêu sư, thân thể nhoáng một cái, theo lưng thú bên trên hướng phía dưới bay tới, từng bước một giẫm lên hư không hướng phía dưới đi tới."),t("br"),t("br"),n._v("“Tại hạ liên minh đế quốc bát tinh hạ phẩm danh sư, Diêu Mạn Thiên, phụng tổng bộ mệnh lệnh, đến đây điều tra Cẩu đường chủ bị giết một chuyện, Thanh Nguyên đế quốc Ngô phó đường chủ có đó không?”"),t("br"),t("br"),n._v("Còn chưa tới đến trước mặt, trang nhã thanh âm liền vang lên."),t("br"),t("br"),n._v("“Điều tra Cẩu đường chủ bị giết?”"),t("br"),t("br"),n._v("Sửng sốt một chút, Trương Huyền bừng tỉnh hiểu ra."),t("br"),t("br"),n._v("Bản thân xông đường thành công, Cẩu đường chủ hướng tổng bộ xin qua một lần, phái bên cạnh vị này chuẩn bát tinh Tống Hiên, về sau Cẩu đường chủ chết rồi, lại chết mấy vị thất tinh danh sư, dính dáng quá lớn, Ngô sư cũng xin một lần."),t("br"),t("br"),n._v("Lần này Tiềm Xung đế quốc, cũng không cách nào làm chủ, bẩm báo đến liên minh đế quốc, mời tới vị này."),t("br"),t("br"),n._v("Bởi vì chênh lệch thời gian, hai người ngồi phi hành Thánh thú, tốc độ đều rất nhanh, vượt qua bình thường đưa tin ngọc bài có thể đưa tin khoảng cách, cho nên, ở giữa cũng không biết đối phương đòi lại."),t("br"),t("br"),n._v("“Tiềm Xung đế quốc thất tinh danh sư, Tống Hiên, gặp qua Diêu sư!”"),t("br"),t("br"),n._v("Tiến về phía trước một bước, Tống Hiên vội vàng ôm quyền."),t("br"),t("br"),n._v("Chuẩn bát tinh danh sư, chỉ là dân gian thuyết pháp, đối cường giả một loại kính sợ cùng tôn trọng, trên thực tế, còn thuộc về Thất Tinh phạm trù, là một vị thất tinh danh sư."),t("br"),t("br"),n._v("“Ta lần trước đi Tiềm Xung đế quốc giảng bài, gặp qua ngươi...”"),t("br"),t("br"),n._v("Xoay người lại, Diêu Mạn Thiên hơi nghi hoặc một chút: “Ngươi tại sao lại ở chỗ này? Vết thương trên người...”"),t("br"),t("br"),n._v("Lấy nàng nhãn lực, lập tức nhìn ra đối phương dưới hông bị thương."),t("br"),t("br"),n._v("Đường đường chuẩn bát tinh cấp danh sư khác, xuất khiếu cường giả đỉnh phong, làm sao lại làm bị thương nơi này?"),t("br"),t("br"),n._v("“Bẩm báo Diêu sư, tại hạ phụng tổng bộ mệnh lệnh, đến đây điều tra xông đường sự tình, kết quả vừa đến liền phát hiện không chỉ Cẩu đường chủ, Điền Thanh phó đường chủ bị người giết hại, liền đế quốc Hoàng đế bệ hạ Sở Thiên Hành, cũng bị người chém giết. Hung thủ giết người bỏ trốn không có bắt lấy... Bất quá, giúp hắn hành hung đồng bọn, không có chạy mất, dựa theo Danh Sư đường quy củ, trước mặt mọi người xử quyết! Ai biết, vị này Trương Huyền Trương sư, không những không tuân thủ trong đường quy định, ngược lại đem người cướp đi, phạm thượng, đem ta đánh thành trọng thương...”"),t("br"),t("br"),n._v("Nhanh chóng đem chuyện nói rõ chi tiết một lần, Tống Hiên cắn răng: “Còn xin Diêu sư vì ta làm chủ!”"),t("br"),t("br"),n._v("“Đem người cướp đi? Đưa ngươi đả thương?”"),t("br"),t("br"),n._v("Nhíu nhíu mày, Diêu Mạn Thiên nhìn về phía Trương Huyền: “Ngươi chính là Trương Huyền? Hắn nói thế nhưng là sự thật?”"),t("br"),n._v(" “Là ta đem người cướp đi, đả thương hắn là binh khí của ta, Kim Nguyên đỉnh!” Trương Huyền ôm quyền, cũng không phủ nhận."),t("br"),t("br"),n._v("Dưới đài nhiều người như vậy tận mắt thấy, phủ nhận cũng vô dụng, còn không bằng sảng khoái thừa nhận."),t("br"),t("br"),n._v("“Tống sư phụng mệnh đến đây, mặc kệ thân phận làm sao, liền là đặc sứ, đại biểu tổng bộ. Không tuân theo đặc sứ phán quyết, cướp pháp trường, hơn nữa đem người đả thương, ngươi có biết... Là bao nhiêu tội danh?”"),t("br"),t("br"),n._v("Diêu Mạn Thiên nói."),t("br"),t("br"),n._v("Trước mắt vị này Trương Huyền, trước khi đến nàng nghe nói, chính là Thanh Nguyên đế quốc xông đường thành công vị kia."),t("br"),t("br"),n._v("Trẻ tuổi như vậy, khiêu chiến cả tòa Danh Sư đường thành công, thiên phú cao, khó có thể tưởng tượng."),t("br"),t("br"),n._v("Nhân vật như vậy, chỉ cần không vẫn lạc, về sau tiền đồ vô lượng... Đã như vậy, làm sao lại làm ra như vậy lỗ mãng không khôn ngoan chuyện, tự hủy tương lai?"),t("br"),t("br"),n._v("“Bẩm báo Diêu sư, việc này dính dáng cực lớn, thân là thất tinh danh sư, tội danh tự nhiên biết rõ, nhưng mà... Làm như vậy, là bị bức ép bất đắc dĩ, không nguyện ý chúng ta Danh Sư đường bị người che đậy, chịu đến chế giễu!”"),t("br"),t("br"),n._v("Trương Huyền khom người."),t("br"),t("br"),n._v("“Che đậy?”"),t("br"),t("br"),n._v("Diêu Mạn Thiên nghi ngờ."),t("br"),t("br"),n._v("“Vâng!”"),t("br"),t("br"),n._v("Nhẹ gật đầu, Trương Huyền giải thích: “Điền Thanh phó đường chủ, là Dị Linh tộc, Thanh Điền nhất mạch Thanh Điền Hoàng, ý niệm chuyển thế mà thành, bản chất là Dị Linh tộc nhân. Cùng Trung Thanh Vương, Thanh Nguyên Hoàng đế Sở Thiên Hành cấu kết, tùy ý phá hư nhân tộc yên lặng...”"),t("br"),t("br"),n._v("Đem Điền Thanh cùng Dị Linh tộc nhân sự tình, nói rõ chi tiết một lần."),t("br"),t("br"),n._v("Bất quá, tóm tắt liên quan tới Ngoan Nhân bộ phận."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Nghe xong giải thích, tràn đầy khiếp sợ, Diêu Mạn Thiên nhịn không được nhìn qua: “Chuyện này, dính dáng cực lớn, ngươi nhưng có chứng cứ?”"),t("br"),t("br"),n._v("Dính dáng một vị phó đường chủ, cùng một cái phong hào đế quốc Hoàng đế bệ hạ, một khi không may xuất hiện, toàn bộ Danh Sư đường đều đem danh dự mất sạch, mất đi công tín lực."),t("br"),t("br"),n._v("“Chuyện này Ngô sư đám người đã báo lên tới liên minh phân bộ, Diêu sư nếu như không tin, có thể tới liên hệ! Có Thanh Điền Hoàng thi thể làm chứng!” Trương Huyền nói."),t("br"),t("br"),n._v("Thanh Điền Hoàng cùng Điền Thanh, mặc dù đều đã chết, nhưng ý niệm có phải hay không chuyển kiếp quan hệ, Danh Sư đường tổng bộ, chỉ cần muốn tra, còn là khẳng định có thể tra ra."),t("br"),t("br"),n._v("Thấy hắn như thế tự tin, Diêu Mạn Thiên nhẹ gật đầu: “Chuyện này, ta sẽ liên hệ tổng bộ, kỹ càng hỏi thăm! Đúng sai, sẽ cho cái rõ ràng trả lời chắc chắn. Bất quá, cho dù Sở Thiên Hành có vấn đề, cũng cần trước thời hạn báo bị tổng bộ, để Danh Sư đường ra tay. Ngươi học sinh đem hắn chém giết, hơn nữa cùng độc sư, độc choáng toàn bộ hoàng cung người... Tống sư phán xử chém giết trước mặt mọi người, cứ việc có sai lầm bất công, nhưng cũng vì ổn định lòng người, không sao! Ngươi xông lại, để vũ khí đem hắn đả thương, khó tránh khỏi có chút quá mức vô lễ đi!”"),t("br"),t("br"),n._v("Danh Sư đường mục đích là vì ổn định toàn bộ nhân tộc."),t("br"),t("br"),n._v("Tôn Cường đám người, độc choáng một tòa hoàng cung, giết chết một cái Hoàng đế, cho dù giết đến là nhân tộc phản đồ, cũng vi phạm với quy định."),t("br"),t("br"),n._v("Thật giống như tội phạm giết người, tự có pháp luật trừng trị đồng dạng, cho dù lại đau hận, cũng không thể tự mình ra tay, nếu không, ngươi cũng chờ tại phạm vào tội."),t("br"),t("br"),n._v("Bọn họ hiện tại chính là như vậy."),t("br"),t("br"),n._v("Chém giết Sở Thiên Hành cho dù là làm chuyện tốt, vẫn như cũ không hợp quy củ, vì ổn định lòng người, đem hắn chém giết, có sai lầm bất công, nhưng cũng không tính là gì... Kết quả, ngươi một cái thất tinh danh sư, xông lại liền đem người ta đặc sứ đánh... Phạm thượng, tội danh cũng là cực lớn."),t("br"),t("br"),n._v("“Diêu sư, vị này Trương Huyền, cậy tài khinh người, không chỉ có là vô lễ, càng xem kỷ luật như không, căn bản là không có đem Danh Sư đường quy củ, nhất định phải nghiêm trị, nếu không, làm sao phục chúng...”"),t("br"),t("br"),n._v("Nghe được Diêu sư nói đỡ cho hắn, Tống Hiên cắn răng."),t("br"),t("br"),n._v("Nam nhân thân phận bị phế, đổi lại ai, đều không đội trời chung."),t("br"),t("br"),n._v("“Im miệng!”"),t("br"),t("br"),n._v("Lời còn chưa dứt, chỉ thấy một bên Trương Huyền sầm mặt lại."),t("br"),t("br"),n._v("“Ngươi...”"),t("br"),t("br"),n._v("Tống Hiên tức thiếu chút nữa nổ tung."),t("br"),t("br"),n._v("“Diêu sư không có để ngươi nói chuyện, đến phiên ngươi chen miệng vào? Đối mặt bát tinh danh sư, tùy ý ngắt lời, ngươi đây là lễ độ?”"),t("br"),t("br"),n._v("Đánh gãy đối phương, Trương Huyền bàn tay vẫy một cái."),t("br"),t("br"),n._v("“Ta...” Tống Hiên sắc mặt trắng nhợt."),t("br"),t("br"),n._v("Diêu sư không có để hắn nói chuyện, tùy tiện ngắt lời, quả thực là đại bất kính."),t("br"),t("br"),n._v("Thấy hắn không lời nào để nói, Trương Huyền không để ý, tiếp tục ôm quyền: “Diêu sư, chuyện này, cũng không phải là Tống sư nói như vậy, mà là có ẩn tình khác!”"),t("br"),t("br"),n._v("“Tống sư vừa rồi luôn miệng nói, Tôn Cường hợp tác Độc điện độc sư, đánh lén hoàng thành... Trên thực tế, Hứa Du trưởng lão bọn họ, sớm đã không phải Độc điện độc sư, mà là... Chiến Sư đường chiến sư!”"),t("br"),t("br"),n._v("“Chiến sư?”"),t("br"),t("br"),n._v("“Không sai, Hứa Du trưởng lão đám người, trước kia là độc sư, nhưng một lòng hướng thiện, đã bị Thanh Nguyên đế quốc Chiến Sư đường hợp nhất, chuyện này sớm đã trình lên Chiến Sư đường tổng bộ, tân nhiệm chiến tử, cũng đã đồng ý, chuyện này, có thể đi tra...”"),t("br"),t("br"),n._v("Trương Huyền nghĩa chính ngôn từ."),t("br"),t("br"),n._v("Chiến tử là Trịnh Dương, có đồng ý hay không, hắn chuyện một câu nói, lại nói, Hứa trưởng lão đám người, gia nhập Chiến Sư đường, quả thực là báo lên qua, hơn nữa đạt được phê chuẩn."),t("br"),t("br"),n._v("Sớm đã không còn là độc sư, mà là Chiến Sư đường, chân chân chính chính chiến sư."),t("br"),t("br"),n._v("“Ồ?”"),t("br"),t("br"),n._v("Diêu Mạn Thiên nhìn về phía Tống Hiên: “Tống sư, chuyện này, ngươi nhưng có điều tra?”"),t("br"),t("br"),n._v("“Ta... Bọn họ là gia nhập Chiến Sư đường, nhưng mà... Giang sơn dễ đổi bản tính khó dời, lặng lẽ luyện chế độc dược, liền là chứng minh...”"),t("br"),t("br"),n._v("Hơi đỏ mặt, Tống Hiên vội nói."),t("br"),t("br"),n._v("Đối phương bị hợp nhất chiến sư sự tình, hắn biết một chút, có điều, cũng không coi ra gì."),t("br"),t("br"),n._v("“Bản tính khó dời? Thân là danh sư, lại nói lên lời này, Tống sư... Ngươi khi còn bé bú sữa, bản tính khó dời... Hiện tại có phải hay không cũng tại tiếp tục ăn?”"),t("br"),t("br"),n._v("Trương Huyền hất lên ống tay áo."),t("br"),t("br"),n._v("(Tiếp tục tiến cử lão nhai sách cũ 《 vô tận đan điền 》, cường giả trùng sinh văn tác phẩm đỉnh cao, Chí Tôn sảng văn, đã hoàn tất, chờ bạn của càng có thể đi xem! Mặt khác, cuối tháng, còn có nguyệt phiếu ư?)"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1246"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1248"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);